import React from "react";
import "./Navbar.css";

function Navbar(props) {
  return (
    <div className="navbar">
      <a href="/"> {props.name} </a>
      <div className="navbar__content">
        <button className="navbar__minimized">Open navbar</button>
      </div>
      <ul class> </ul>
    </div>
  );
}

export default Navbar;
